// TestSQL.jsx
import React, { useState } from 'react';

function TestSQL() {
    const [resultado, setResultado] = useState(null);
    const [loading, setLoading] = useState(false);

    // Usando el hostname del servidor
    const SERVIDOR = 'DE250329.esmax.cl';
    const PUERTO = '80';  // Cambia si Apache usa otro puerto (3001, 8080, etc.)

    const probar = async () => {
        setLoading(true);
        setResultado(null);

        const url = `http://${SERVIDOR}:${PUERTO}/test-sql.php`;

        console.log('üîó Conectando a:', url);

        try {
            const res = await fetch(url, {
                method: 'GET',
                headers: {
                    'Content-Type': 'application/json'
                },
                mode: 'cors'
            });

            console.log('üì° Status:', res.status);

            if (!res.ok) {
                throw new Error(`HTTP ${res.status}: ${res.statusText}`);
            }

            const data = await res.json();
            console.log('‚úÖ Datos:', data);
            setResultado(data);

        } catch (err) {
            console.error('‚ùå Error completo:', err);
            setResultado({
                success: false,
                error: err.message,
                servidor: SERVIDOR,
                puerto: PUERTO,
                url_completa: `http://${SERVIDOR}:${PUERTO}/test-sql.php`
            });
        } finally {
            setLoading(false);
        }
    };

    return (
        <div style={{
            padding: '30px',
            fontFamily: 'Arial, sans-serif',
            maxWidth: '900px',
            margin: '0 auto'
        }}>
            <h2>üß™ Test Conexi√≥n SQL Server</h2>
            <div style={{
                backgroundColor: '#f8f9fa',
                padding: '15px',
                borderRadius: '5px',
                marginBottom: '20px'
            }}>
                <p style={{ margin: '5px 0' }}>
                    <strong>üåê Servidor XAMPP:</strong> {SERVIDOR}:{PUERTO}
                </p>
                <p style={{ margin: '5px 0' }}>
                    <strong>üóÑÔ∏è SQL Server:</strong> DE250329\SQLEXPRESS
                </p>
                <p style={{ margin: '5px 0' }}>
                    <strong>üìç URL completa:</strong> http://{SERVIDOR}:{PUERTO}/test-sql.php
                </p>
            </div>

            <button
                onClick={probar}
                disabled={loading}
                style={{
                    padding: '15px 40px',
                    fontSize: '18px',
                    backgroundColor: loading ? '#ccc' : '#007bff',
                    color: 'white',
                    border: 'none',
                    borderRadius: '5px',
                    cursor: loading ? 'not-allowed' : 'pointer',
                    fontWeight: 'bold',
                    boxShadow: loading ? 'none' : '0 4px 6px rgba(0,0,0,0.1)'
                }}
            >
                {loading ? '‚è≥ Conectando...' : 'üöÄ Probar Conexi√≥n'}
            </button>

            {loading && (
                <div style={{
                    marginTop: '20px',
                    padding: '15px',
                    backgroundColor: '#e7f3ff',
                    border: '2px solid #007bff',
                    borderRadius: '5px'
                }}>
                    <p style={{ margin: 0 }}>
                        ‚è≥ Conectando a <strong>{SERVIDOR}</strong>...
                    </p>
                </div>
            )}

            {resultado && (
                <div style={{
                    marginTop: '20px',
                    padding: '20px',
                    backgroundColor: resultado.success ? '#d4edda' : '#f8d7da',
                    border: `3px solid ${resultado.success ? '#28a745' : '#dc3545'}`,
                    borderRadius: '8px'
                }}>
                    <h3 style={{ margin: '0 0 15px 0' }}>
                        {resultado.success ? '‚úÖ CONEXI√ìN EXITOSA' : '‚ùå ERROR DE CONEXI√ìN'}
                    </h3>

                    <div style={{ fontSize: '15px' }}>
                        <p><strong>Mensaje:</strong> {resultado.mensaje || resultado.error}</p>

                        {resultado.servidor && (
                            <>
                                <p><strong>Servidor:</strong> {resultado.servidor}</p>
                                <p><strong>Puerto:</strong> {resultado.puerto}</p>
                            </>
                        )}

                        {resultado.url_completa && (
                            <p style={{
                                fontSize: '13px',
                                color: '#666',
                                wordBreak: 'break-all'
                            }}>
                                <strong>URL intentada:</strong> {resultado.url_completa}
                            </p>
                        )}
                    </div>

                    {resultado.datos && resultado.datos.length > 0 && (
                        <div style={{ marginTop: '20px' }}>
                            <h4>üìä Datos obtenidos: {resultado.datos.length} registros</h4>
                            <div style={{
                                backgroundColor: '#f5f5f5',
                                padding: '15px',
                                borderRadius: '5px',
                                overflow: 'auto',
                                maxHeight: '400px'
                            }}>
                                <pre style={{
                                    margin: 0,
                                    fontSize: '12px',
                                    fontFamily: 'Consolas, monospace'
                                }}>
                                    {JSON.stringify(resultado.datos, null, 2)}
                                </pre>
                            </div>
                        </div>
                    )}
                </div>
            )}
        </div>
    );
}

export default TestSQL;
